        <div class=\"main-container\">
            {% block body %}{% endblock %}
        </div>
    </body>
</html>", "base.html.twig", "C:\\Users\\alexm\\Desktop\\DEV\\TestTechniqueWikicampersMORENOAlex\\templates\\base.html.twig");
